import React from 'react';
import './MelleriSearchMainPage.css';

// Ï†úÎ™©Í≥º Î∂ÄÏ†úÎ™©, ÏÑπÏÖò Ï†úÎ™©Îì§ÏùÑ ÏÉÅÏàòÎ°ú Î∂ÑÎ¶¨ÌïòÏó¨ Ï†ïÏùòÌïòÍ≥† ÎÇ¥Î≥¥ÎÉÖÎãàÎã§
export const PAGE_TITLE = "MelleriSearch";
export const PAGE_SUBTITLE = "ÏßÄÎä•Ìòï Îç∞Ïù¥ÌÑ∞ Í≤ÄÏÉâ Î∞è Î∂ÑÏÑù ÏãúÏä§ÌÖú";

// ÏÑπÏÖò Ï†úÎ™©Îì§ÎèÑ ÏÉÅÏàòÎ°ú Î∂ÑÎ¶¨
export const SECTION_TITLES = {
  SERVICE_OVERVIEW: "ÏÑúÎπÑÏä§ Í∞úÏöî",
  MAIN_FEATURES: "Ï£ºÏöî Í∏∞Îä•"
};

// Ìë∏ÌÑ∞ Ï†ïÎ≥¥Î•º ÏÉÅÏàòÎ°ú Î∂ÑÎ¶¨
export const FOOTER_INFO = "¬© 2025 Mellerikat AI Technologies | Î≤ÑÏ†Ñ 1.2.0 | Í≤ÄÏÉâ ÎπÖÎç∞Ïù¥ÌÑ∞ Ïó∞Íµ¨ÏÜå";

// ÏÑúÎπÑÏä§ ÏÑ§Î™ÖÏùÑ ÏÉÅÏàòÎ°ú Î∂ÑÎ¶¨
export const SERVICE_DESCRIPTION = 
  "MelleriSearchÎäî Î≥µÏû°Ìïú Í∏∞ÏóÖ Îç∞Ïù¥ÌÑ∞Î•º ÏâΩÍ≥† Îπ†Î•¥Í≤å Í≤ÄÏÉâÌïòÍ≥† Î∂ÑÏÑùÌï† Ïàò ÏûàÎäî ÏßÄÎä•Ìòï Í≤ÄÏÉâ ÏãúÏä§ÌÖúÏûÖÎãàÎã§. " +
  "ÏûêÏó∞Ïñ¥ Í∏∞Î∞ò Í≤ÄÏÉâÍ≥º Í∞ïÎ†•Ìïú Î∂ÑÏÑù Í∏∞Îä•ÏùÑ ÌÜµÌï¥ ÎπÑÏ†ïÌòï Îç∞Ïù¥ÌÑ∞Ïùò Ìå®ÌÑ¥ÏùÑ Î∞úÍ≤¨ÌïòÍ≥†, Ïã§ÏãúÍ∞ÑÏúºÎ°ú ÌÜµÏ∞∞Î†• ÏûàÎäî Ï†ïÎ≥¥Î•º Ï†úÍ≥µÌï©ÎãàÎã§. " +
  "Îã§ÏñëÌïú Îç∞Ïù¥ÌÑ∞ ÏÜåÏä§Î•º ÌÜµÌï© Í¥ÄÎ¶¨ÌïòÎ©∞ ÏÇ¨Ïö©Ïûê ÏπúÌôîÏ†ÅÏù∏ Ïù∏ÌÑ∞ÌéòÏù¥Ïä§Î°ú Îπ†Î•∏ ÏùòÏÇ¨Í≤∞Ï†ïÏùÑ ÏßÄÏõêÌï©ÎãàÎã§.";

// ÏÑúÎπÑÏä§ Í∏∞Îä• Ïπ¥Îìú Îç∞Ïù¥ÌÑ∞Î•º ÏÉÅÏàòÎ°ú Î∂ÑÎ¶¨
export const FEATURE_CARDS = [
  {
    icon: "üîç",
    title: "ÏßÄÎä•Ìòï Í≤ÄÏÉâ",
    description: [
      "ÏûêÏó∞Ïñ¥ Í∏∞Î∞ò Í≤ÄÏÉâ Í∏∞Îä•",
      "Îã§Íµ≠Ïñ¥ ÏßÄÏõê Î∞è ÏùòÎØ∏ Î∂ÑÏÑù",
      "Ïª®ÌÖçÏä§Ìä∏ Í∏∞Î∞ò Í≤ÄÏÉâ Í≤∞Í≥º Ï†úÍ≥µ",
      "Ïã§ÏãúÍ∞Ñ Í≤ÄÏÉâ Ï†úÏïà Î∞è ÏûêÎèô ÏôÑÏÑ±"
    ]
  },
  {
    icon: "üìä",
    title: "Îç∞Ïù¥ÌÑ∞ Î∂ÑÏÑù",
    description: [
      "ÌÜµÌï© Îç∞Ïù¥ÌÑ∞ ÎåÄÏãúÎ≥¥Îìú",
      "Ìä∏Î†åÎìú Î∞è Ìå®ÌÑ¥ ÏãúÍ∞ÅÌôî",
      "ÎßûÏ∂§Ìòï Î¶¨Ìè¨Ìä∏ ÏÉùÏÑ±",
      "ÏòàÏ∏° Î∂ÑÏÑù Î∞è Ïù∏ÏÇ¨Ïù¥Ìä∏ ÎèÑÏ∂ú"
    ]
  },
  {
    icon: "üîÑ",
    title: "Îç∞Ïù¥ÌÑ∞ ÌÜµÌï©",
    description: [
      "Îã§ÏñëÌïú Îç∞Ïù¥ÌÑ∞ ÏÜåÏä§ Ïó∞Í≤∞",
      "Ïã§ÏãúÍ∞Ñ Îç∞Ïù¥ÌÑ∞ ÎèôÍ∏∞Ìôî",
      "Íµ¨Ï°∞Ìôî/ÎπÑÍµ¨Ï°∞Ìôî Îç∞Ïù¥ÌÑ∞ Ï≤òÎ¶¨",
      "ÏïàÏ†ÑÌïú Îç∞Ïù¥ÌÑ∞ Ï†ëÍ∑º Í¥ÄÎ¶¨"
    ]
  }
];

const MelleriSearchMainPage = () => {
  // Í∏∞Îä• Ïπ¥Îìú ÌëúÏãú Ïó¨Î∂Ä
  const showFeatureCards = true;

  return (
    <div className="melleri-search-main-page">
      <div className="page-header">
        <h1>{PAGE_TITLE}</h1>
        <p className="subtitle">{PAGE_SUBTITLE}</p>
      </div>

      <div className="feature-section">
        <h2>{SECTION_TITLES.SERVICE_OVERVIEW}</h2>
        <div className="service-description-container">
          <p className="service-description">{SERVICE_DESCRIPTION}</p>
          <div className="service-tags">
            <span className="service-tag">ÏßÄÎä•Ìòï Í≤ÄÏÉâ</span>
            <span className="service-tag">Îç∞Ïù¥ÌÑ∞ Î∂ÑÏÑù</span>
            <span className="service-tag">ÌÜµÌï© ÎåÄÏãúÎ≥¥Îìú</span>
            <span className="service-tag">ÏûêÏó∞Ïñ¥ Ï≤òÎ¶¨</span>
            <span className="service-tag">Ïã§ÏãúÍ∞Ñ Ïù∏ÏÇ¨Ïù¥Ìä∏</span>
          </div>
        </div>
      </div>

      <div className="feature-section">
        <h2>{SECTION_TITLES.MAIN_FEATURES}</h2>
        <div className="feature-grid">
          {FEATURE_CARDS.map((card, index) => (
            <div className="feature-card" key={index}>
              <div className="icon">{card.icon}</div>
              <h3>{card.title}</h3>
              <ul className="feature-list">
                {card.description.map((item, idx) => (
                  <li key={idx}>{item}</li>
                ))}
              </ul>
            </div>
          ))}
        </div>
      </div>

      <footer className="page-footer">
        <p>{FOOTER_INFO}</p>
      </footer>
    </div>
  );
};

export default MelleriSearchMainPage;
